import React from "react";
import data from "./Data";
import './Gallery.css'

const Gallery = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
  return (
    <>
      <section className="collection">
        <div className="container top">
            {data.map((value) => {
                return (
                    <div className="box">
                        <img src={value.cover}/>
                    </div>
                )
            })}
        </div>
      </section>
    </>
  );
};

export default Gallery;
